  false,\n\t\"url\": null,\n\t\"notes\": \"The 8-bit 4-Band stack (Red, Green, Blue,
  Infrared) were flown with a Z/I Intergraph DMC airborne digital sensor. The flight
  season was from December 15, 2008 through March 15, 2009. The flight dates are as
  follows: December 3, 2008 and December 5, 2008. All images were collected between
  10:00 AM to 2:30 PM to minimize shadows. All images were obtained under cloud free
  conditions. With an RMSE of 1.24 feet at the 95% confidence interval (0.72 feet
  RMSE), the RMSE meets and exceeds the specified horizontal accuracy of 3.46 feet
  at the 95% confidence interval (2.0 feet RMSE). The project title is FY 2009 Digital
  Orthophoto (B089). The Purchase Order number is 09POSOW0201. The Work Order Name
  is Southwest District One-Foot Orthophoto. The Work Order Number is 4. The Project
  managers are April Davis with the District; Larry Solien with Pinellas County and
  Gary Florence with the Consultant. The Consultant is GMR Aerial surveys, Inc. dba
  Photo Science.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
